<style>
    @keyframes anime-modal-two-backdrop-in {
      0% {
        opacity: 0
      }

      to {
        opacity: 1
      }
    }

    @keyframes anime-modal-two-backdrop-out {
      0% {
        opacity: 1
      }

      to {
        opacity: 0
      }
    }

    .button {
      background-color: var(--button-default-background-color, transparent);
      border: 1px solid var(--button-default-border-color, transparent);
      border-radius: var(--border-radius-md);
      color: var(--button-default-text-color, inherit);
      cursor: pointer;
      display: inline-block;
      outline: none;
      text-align: center;
      transition: .15s cubic-bezier(.22, 1, .36, 1), background-position 0s
    }

    @supports selector(:focus-visible) {
      .button {
        outline: unset
      }
    }

    .button,
    .button:active,
    .button:focus,
    .button:focus-within,
    .button:hover {
      text-decoration: none
    }

    .button.is-hover,
    .button:hover {
      background-color: var(--button-hover-background-color, transparent);
      border-color: var(--button-hover-border-color, transparent);
      color: var(--button-hover-text-color, inherit);
      opacity: 1
    }

    @supports not selector(:focus-visible:has(a, b)) {

      .button:focus,
      .button:focus-within {
        border-color: var(--focus-outline);
        box-shadow: 0 0 0 .1875rem var(--focus-ring);
        color: var(--button-default-text-color, inherit)
      }
    }

    @supports selector(:focus-visible:has(a, b)) {

      .button:focus-visible,
      .button:has(:focus-visible) {
        border-color: var(--focus-outline);
        box-shadow: 0 0 0 .1875rem var(--focus-ring);
        color: var(--button-default-text-color, inherit)
      }
    }

    .button.is-active,
    .button:active,
    .button[aria-expanded=true]:not([aria-controls]) {
      background-color: var(--button-active-background-color, transparent);
      border-color: var(--button-active-border-color, transparent);
      color: var(--button-active-text-color, inherit);
      opacity: 1
    }

    @supports selector(:focus-visible) {
      .button-underline {
        outline: unset
      }
    }

    @supports not selector(:focus-visible:has(a, b)) {

      .button-underline:focus-within:after,
      .button-underline:focus:after {
        border-color: var(--focus-outline);
        box-shadow: 0 0 0 .1875rem var(--focus-ring)
      }
    }

    @supports selector(:focus-visible:has(a, b)) {

      .button-underline:focus-visible:after,
      .button-underline:has(:focus-visible):after {
        border-color: var(--focus-outline);
        box-shadow: 0 0 0 .1875rem var(--focus-ring)
      }
    }

    .button-solid-norm {
      --button-default-background-color: var(--interaction-norm);
      --button-hover-background-color: var(--interaction-norm-major-1);
      --button-active-background-color: var(--interaction-norm-major-2);
      --button-default-text-color: var(--interaction-norm-contrast);
      --button-hover-text-color: var(--interaction-norm-contrast);
      --button-active-text-color: var(--interaction-norm-contrast)
    }

    .button-outline-norm {
      --button-default-background-color: var(--background-norm);
      --button-hover-background-color: var(--interaction-norm-minor-2);
      --button-active-background-color: var(--interaction-norm-minor-1);
      --button-default-border-color: var(--interaction-norm-major-1);
      --button-hover-border-color: var(--interaction-norm-major-2);
      --button-active-border-color: var(--interaction-norm-major-3);
      --button-default-text-color: var(--interaction-norm-major-1);
      --button-hover-text-color: var(--interaction-norm-major-2);
      --button-active-text-color: var(--interaction-norm-major-3)
    }

    .button-ghost-weak {
      --button-default-background-color: var(--interaction-default);
      --button-hover-background-color: var(--interaction-default-hover);
      --button-active-background-color: var(--interaction-default-active)
    }

    .button-ghost-weak {
      --button-default-text-color: var(--text-norm);
      --button-hover-text-color: var(--text-norm);
      --button-active-text-color: var(--text-norm)
    }

    .button-small {
      padding: .2142857143em .7857142857em
    }

    .button-large {
      font-size: 1.1428571429em;
      line-height: 1.5;
      padding: .5625em 1.1875em
    }

    .button-for-icon.button-small {
      padding: .3571428571em
    }

    .button-for-icon>svg {
      display: block;
      transition: opacity .25s ease-out
    }

    }

      .sign-layout-header {
        padding-left: 1.4285714286em;
        padding-right: 1.4285714286em
      }
    }

    @media (max-width:28.125em) {
      .sign-layout-header {
        padding: 0
      }
    }

    .sign-layout-title {
      font-size: 2em
    }

    @media (max-width:28.125em) {
      .sign-layout-title {
        font-size: 1.4285714286em;
        margin: 0;
        padding-left: 0;
        padding-right: 0
      }
    }

    .sign-layout-main-content {
      padding: 1.7142857143em 3.1428571429em 3.1428571429em
    }

    @media (max-width:42.5em) {
      .sign-layout-main-content {
        padding: 0 1.4285714286em 1.4285714286em
      }
    }

    @media (max-width:28.125em) {
      .sign-layout-main-content {
        padding-left: 0;
        padding-right: 0

      background-image: url(data:image/png;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7)

      .sign-layout-container {
        padding-left: 1em;

    .old-link:before {
      content: url(data:image/png;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7);
      position: absolute
    }

    @-webkit-viewport {
      width: device-width
    }

    @-moz-viewport {
      width: device-width
    }

    @-o-viewport {
      width: device-width
    }

    @viewport {
      width: device-width
    }

    footer,
    main {
      display: block
    }

    body,
    button,
    form,
    html,
    input {
      margin: 0;
      padding: 0
    }

    button,
    input {
      -webkit-appearance: none;
      background: transparent;
      border: 0;
      font: inherit
    }

    input[type=checkbox] {
      -webkit-appearance: checkbox
    }

    button,
    label {
      cursor: pointer
    }

    button::-moz-focus-inner {
      border: 0;
      padding: 0
    }

    button,
    input,
    label {
      color: currentcolor;
      vertical-align: middle
    }

    iframe {
      vertical-align: middle
    }

    iframe {
      border: 0
    }

    html {
      quotes: "“""”""‘""’"
    }

    :lang(fr) {
      quotes: "« "" »""“""”""‘""’"
    }

    :lang(en) {
      quotes: "“""”""‘""’"
    }

    :lang(es) {
      quotes: "«""»""“""”"
    }

    :lang(it) {
      quotes: "« "" »""“""”"
    }

    :lang(de) {
      quotes: "„""“""‚""‘"
    }

    :lang(ja) {
      quotes: "「""」""『""』"
    }

    :lang(ar) {
      quotes: "“""”"
    }

    *,
    :after,
    :before {
      box-sizing: inherit
    }

    html {
      box-sizing: border-box;
      overscroll-behavior: none
    }

    body {
      background: var(--background-norm);
      min-height: 100%
    }

    ::selection {
      background-color: var(--selection-background-color);
      color: var(--selection-text-color)
    }

    .link,
    a {
      color: var(--link-norm);
      cursor: pointer;
      text-decoration: underline
    }

    .link:focus,
    .link:hover,
    a:focus,
    a:hover {
      color: var(--link-hover);
      text-decoration: none
    }

    .link:active,
    a:active {
      color: var(--link-active);
      text-decoration: none
    }

    @supports selector(:focus-visible) {

      .link:focus:not(:focus-visible),
      a:focus:not(:focus-visible),
      button:focus:not(:focus-visible) {
        outline: 0
      }
    }

    input,
    svg {
      height: auto;
      max-width: 100%
    }

    input[type=checkbox] {
      background-color: transparent;
      border: 0
    }

    hr {
      background-color: var(--border-norm);
      border: 0;
      height: 1px;
      margin: 0 0 1em;
      padding: 0
    }

    .ui-standard,
    :root {
      --signal-danger-hover: var(--signal-danger-major-1);
